import React from 'react';
import './SearchForm.css'

function SearchForm() {
    return (
        <form type="sunbmit" className="search__form">
            <input type="text" autocomplete="off" className="search__input" placeholder="Введите тему новости" required={true} />
            <button type="submit" className="search__button">Искать</button>
        </form>
    )
}

export default SearchForm;
